import React from 'react'
import Img from "../../images/car.jpg"

const Blog = ({ img, blogText }) => {
    return (
        <article className="blog">
            <picture>
                <img src={Img} alt="" />
            </picture>
            <p></p>
        </article>
    )
}

export default Blog
